import React from "react";
import DeleteIcon from "@material-ui/icons/Delete";

function Comment(props) {
    function handleClick() {
        props.onDelete(props.id);
    }

    return (
        <div className="note">
            <p>{props.comment}</p>
            <button onClick={handleClick}>
                <DeleteIcon />
            </button>
        </div>
    );
}

export default Comment;
